import React, { Component } from 'react'
import { Calendar } from 'antd';

export default class Input extends Component {

    onPanelChange(value, mode) {
        console.log(value, mode);
    }

    render() {
        return (
            <div>
                <form action="">
                    选择某一天的注射点存储疫苗：<Calendar fullscreen={false} onPanelChange={onPanelChange} /> <br/>
                    注射点1：<input type="text" placeholder="请输入想要储存的疫苗量" /> <button>存入</button><br/>
                    注射点2：<input type="text" placeholder="请输入想要储存的疫苗量"/> <button>存入</button><br/>
                    注射点3：<input type="text" placeholder="请输入想要储存的疫苗量"/> <button>存入</button><br/>
                    注射点4：<input type="text" placeholder="请输入想要储存的疫苗量"/> <button>存入</button><br/>
                    这天总共存储了？？支疫苗
                </form>
            </div>
        )
    }
}
